function template($aim,$jsonLink,$type="get"){var str=$aim.html();$.ajax({url:$jsonLink,type:$type,dataType:"json",success:function(data,status){if("success"!=status)return console.log("Ajax请求失败！");$.each(data,function(index,value){str=str.replace(new RegExp("{{"+value.codeName+"}}","g"),value.codeText)}),$aim.html(str)}})}